import React from 'react';
import ReactDOM from 'react-dom';
const rootToRender = document.getElementById('ReactDOM');

function contentToRender(){
	return(

<ul>
	<li>Babi</li>
	<li>Anjing</li>
	<li>Kucing</li>
</ul>

	);
}

ReactDOM.render(
<contentToRender />
,rootToRender);
